import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { fetchData } from "../asyncActions/fetchQuestions";
// import { selectQuestions } from "../slices/rootSlice";

function Question() {
  const questions = useSelector((c) => c.rootReducer.data[0]);
  console.log(questions);
  // const q = useSelector(selectQuestions);
  // console.log(q);
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(fetchData());
    if (fetchData.fulfilled) {
      console.log(questions);
    }
  }, []);

  return (
    <div className="App__container--question">
      <span className="App__container--question--bf">-</span>
    </div>
  );
}

export default Question;
